export const addStudents = (data) => {
  console.log("data", data);
  const url = `https://rocky-wave-71489.herokuapp.com/student`;
  return fetch(url, {
    method: "POST",
    // headers: { Authorization: "Bearer " + token, Accept: "application/json" },
    body: JSON.stringify(data),
  })
    .then((data) => {
      return data.json();
    })
    .catch((error) => {
      console.log(error);
      throw error;
    });
};
